import React, { Component } from 'react'
import './index.css'
export default class Demo extends Component {
    render() {
        return (
            <div className='parent'>
                <h3>我是Parent组件</h3>
                <A></A>
                <B></B>
            </div>
        )
    }
}

class A extends Component {
    render() {
        return (
            <div className='child'>
                <h3>我是a组件</h3>
            </div>
        )
    }
}
class B extends Component {
    render() {
        return (
            <div className='grand'>
                <h3>我是b组件</h3>
            </div>
        )
    }
}
